import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function CDM(props) {
  const [cdm, setCDM] = useState([]);
  const [isLoading, setLoading] = useState(true);

  function fetchRooms() {
    axios
      .get("/cdm/")
      .then((res) => {
        setCDM(res.data);
        setLoading(false);
        console.log(res);
      })
      .catch((err) => {
        console.log(err);
      });
  }

  useEffect(() => {
    fetchRooms();
  }, []);

  const Card = (props) => {
    return (
      <div className="card text-center">
        <div className="cardBody mx-auto">
          <img
            src={`/images/${props.imgLink}`}
            className="rounded-full mx-auto w-32 h-32 shadow-2xl border-4 border-white"
            alt="2021Feb"
          />
          <div className="content shadow-lg px-6 pt-12 pb-6 -mt-10 border border-red-50">
            <h3 className="font-semibold text-lg text-red-400 py-3 border-b border-red-400">
              {props.name}
            </h3>
            <div className="body py-2">{props.content}</div>
            <div className="cardFooter py-2 border-t border-gray-200">
              <Link to={props.link}>ဆက်သွယ်ရန်</Link>
            </div>
          </div>
        </div>
      </div>
    );
  };
  return (
    <div className="mx-auto container px-4">
      <div className="cardWrap grid md:grid-cols-2 lg:grid-cols-4 gap-2">
        <Card
          imgLink="2021Feb.jpg"
          name="၂/၂၀၂၁ ခိုင်မြဲသောလက်များ"
          content={[
            "ကူညီ လှူဒါန်းလိုသူများ ဆက်သွယ်ရန်",
            <br />,
            "09752957515",
            <br />,
            "09766876268",
            <br />,
            "095130789",
            <br />,
            "09421111594",
            <br />,
            "09252386810",
          ]}
          link="https://www.facebook.com/2021Feb/"
        />
        <Card
          imgLink="wesupporthero.jpg"
          name="We Support Heroes"
          content={[
            "အလှူငွေ လက်မခံသေးပါ",
            <br />,
            <br />,
            "အကူအညီ လိုပါက ဆက်သွယ်ရန်",
            <br />,
            "09752957515",
            <br />,
            <br />,
            <br />,
          ]}
          link="https://www.google.com"
        />

        <div className="card text-center">
          <div className="cardBody mx-auto">
            <img
              src="/images/21savagemm.png"
              className="rounded-full mx-auto w-32 h-32 shadow-2xl border-4 border-white"
              alt="2021Feb"
            />
            <div className="content shadow-lg px-6 pt-12 pb-6 -mt-10 border border-red-50">
              <h3 className="font-semibold text-lg text-red-400 py-3 border-b border-red-400">
                21 Savage MM
              </h3>
              <div className="body py-2">
                လှူဒါန်းလိုသူများ/အကူအညီလိုသူများ အောက်မှ ဆက်သွယ်ရန်ကို နှိပ်၍
                message box မှ​ဆက်သွယ်ပါ။ <br />
              </div>
              <div className="cardFooter py-2 border-t border-gray-200">
                <a
                  href="https://www.facebook.com/21savagemm"
                  target="_blank"
                  rel="noreferrer"
                >
                  ဆက်သွယ်ရန်
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CDM;
